import csv, urllib2, pprint, base64

def read_csv(csvFile):
    # url string
    url = "http://www.isaham.my/csv/fundamental/AJI.csv"

    # load url data
    try:
        response = urllib2.urlopen(url)
        cr = csv.reader(response)
        dataTrend = {}
        for row in cr:
            dataTrend[ row.pop(0) ] = row
        return dataTrend
    except:
        return  None

